/** FOR TESTING ONLY: toggle whether you load this content from ipm.corel.com DEV, STG or PROD **/
/** based on value/existence of HKEY_LOCAL_MACHINE\SOFTWARE\Corel\autuni_env **/
var envflag = 'prod';
function checkenv() {
	location.href = "pcucmd://validate?param=/registry/regkey[@name='hklm/software/corel']/regval[@name='autuni_env'][@value='dev']";
	location.href = "pcucmd://CallScriptFunc?condition=true&funcname=devorstg&param=dev";
	location.href = "pcucmd://CallScriptFunc?condition=false&funcname=devorstg&param=stg";
}
function devorstg(env) {
	envflag = env;
}
/** END FOR TESTING ONLY **/

function onpageload()
{
	//get language param value
	var langcode = getParamVal("Lang");
	if (langcode == '') {
		langcode = 'en';
	}
	langcode = langcode.toLowerCase();

	/** FOR TESTING ONLY **/
	//if reg string exists its not PROD so check for DEV vs STG, if reg string does not exist its PROD
	location.href = "pcucmd://validate?param=/registry/regkey[@name='hklm/software/corel']/regval[@name='autuni_env']";
	location.href = "pcucmd://CallScriptFunc?condition=true&funcname=checkenv";
	//base iframe URL
	var iframeURL = 'https://ipm.corel.com/cdgs/2024/ipmchangecreds_';
	switch(envflag) {
	  case 'dev':
		iframeURL = 'https://dev.ipm.corel.public.corel.net/cdgs/2024/ipmchangecreds_';
		break;
	  case 'stg':
		iframeURL = 'https://stg.ipm.corel.public.corel.net/cdgs/2024/ipmchangecreds_';
		break;
	  default:
		iframeURL = 'https://ipm.corel.com/cdgs/2024/ipmchangecreds_';
	}
	/** END FOR TESTING ONLY **/

	//construct iframe src URL
	iframeURL += langcode + '.html' + location.search.substring(0);
	//iframeURL = addGoogleAnalyticsParamsToUrl(iframeURL);

	//append the iframe src URL
	document.getElementById('msgiframe').src = iframeURL;
	location = 'pcucmd://FrameDataLoaded';
}
